import style from './header.module.css'

const Header =()=>{
    return(
        <header>
        <h1 className={style.logo}> LIVE-TYR</h1>
        <nav>
                <a className={style.nav-item} href="">Избранное</a>
                <a className={style.nav-item} href="">Заявки</a>
        </nav>
    </header>
    )
}
export default Header
